import React , {Component} from 'react';

class App extends Component {
  render(){
    return (
      <ThemeContextProvider>
        <AuthContextProvider>
      <div className="App">


           <NavBar/>
           <BookContextProvider>
           <Booklist/>
           </BookContextProvider>



           <Button/>

      </div>
      </AuthContextProvider>
      </ThemeContextProvider>


    );
  }

}

export default App;
